This group includes five species, all of which have been sequenced and form a strongly supported monophylum (see 
Fig. 1
).

Females. Protibia with apical spur arising from truncate front edge, apical digit absent. Tooth on the underside of protibia usually smaller than in males (except similar in
L. cardwellensis
). Inner edge of metatibia not crenulate.
